description:
Verenigd Koninkrijk
Misdaad / Drama

240 minuten (miniserie, 4 delen)


geregisseerd door James Kent
met Ashley Walters, Warren Brown en Steven Mackintosh

Drie medewerkers van een veiligheidsdepot beramen een overval. Ze willen miljoenen ponden buitmaken. John, de manager van een telkamer, staat oog in oog met zijn grootste angst: een gewapende overval.


Met dank aan Solidjeuh



Eerder dit jaar uitgezonden op de BBC




